const { ipcRenderer } = require("electron");
const copy = require("copy-to-clipboard");

module.exports.renderNavbar = function(document) {
    document.addEventListener("DOMContentLoaded", function() {
        const container = document.createElement("div");
        container.innerHTML = html;

        const space = document.createElement("div");
        space.className = "e-space";

        const style = document.createElement("style");
        style.type = "text/css";
        style.appendChild(document.createTextNode(css));

        container.querySelector(".e-address-text").innerHTML = location.href;
        container.querySelector(".e-reload").addEventListener("click", () => {
            ipcRenderer.send("reload");
        });
        container.querySelector(".e-copy").addEventListener("click", () => {
            copy(location.href);
        });

        const head = document.head;
        const body = document.body;

        head.appendChild(style);
        body.insertBefore(space, body.firstChild);
        body.insertBefore(container, body.firstChild);
    }, { once: true });
};

